import './esquerda.css';

function Esquerda() {
  return (
    <div className="esquerda">
      <h2>Menu</h2>
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
      </ul>
    </div>
  );
}

export default Esquerda;
